import React, { Component } from "react";
import Layout from "../../components/Layout";

class Gogaxy extends Component{
    
    render(){
        return(
            <Layout>
                <div className="container">
                    <div className="row d-flex justify-content-center">
                        <h1>The Resume Game</h1>
                        <div className="shadow-lg p-3 mb-5 bg-dark rounded">
                        <iframe frameborder="0" src="https://itch.io/embed/540723" width="552" height="167"><a href="https://aowsay.itch.io/go-gaxy">Go Gaxy by AOWSAY</a></iframe>
                        </div>                    
                    </div>
                <br/>
                </div>                 
            </Layout>               
        )
    }
}

export default Gogaxy;
